Cult Australian TV show from the late 90&amp;#039;s Marcus Graham went on to appear in Mulholland drive and elsewhere.

This show revolves around Elvis Maginnis, a former policeman from a criminal family, who now runs a dry-cleaning business. He lives between in a grey area between good and bad.
The show is an off-beat crime drama hat relies heavily on humor, contemporary music and a touch of the bizarre.

When his stepfather receives death threats and the police are unwilling to do anything, ex-cop Elvis Maginnis must get involved.
